INSERT INTO `especie` (`id`, `indice`, `especie`, `descricao`) VALUES
(1, '1.1', 'Organização e estrutura', 'Classificar os documentos que retratem a organização e estrutura da Fundação Casa de Rui Barbosa - FCRC; incluem-se as alterações, propostas de alterações e projetos de alterações da instituição.'),
(2, '1.1.1', 'Criação. Situação jurídica', 'Classificar os documentos referentes à criação da FCRB, transformações institucional e jurídica, bem como tombamento (de acordo com definições do Poder Público no que tange à concepção da FCRB como bem cultural e , portanto, como objeto de proteção).'),
(3, '1.1.2', 'Estatuto. Regimento. Regulamento', 'Classificar os documentos sobre normas internas e atribuições da FCRB'),
(4, '1.1.3', 'Estruturação. Organograma', 'Classificar os documentos referentes à estrutura organizacional da FCRB. Inclui reformas, criação, transformação e  extinção de setores da FCRB , bem como as representações gráficas da estrutura da instituição (organogramas).'),
(5, '1.1.4', 'Coselhos', 'Classificar os documentos referentes ao Conselho Fiscal e Conselho Consultivo da FCRB. Abrir pasta específica para cada conselho.'),
(6, '1.1.5', 'Normas de trabalhos', 'Classificar os documentos referentes às normas de preenchimento de formulários administrativos, às normas de preenchimento de formulários administrativos, às rotinas de trabalho na área administrativa e na área financeira, às rotinas de reuniões administrativas de caráter geral, etc. Inclui legislação sobre contratos, convênios, acordos, Plano Real, SICAF, etc.'),
(7, '1.2 ', 'Registros nos Órgãos competentes', 'Classificar os registros da FCRB como CGC, Títulos e Marcas, etc.'),
(8, '1.3', 'Programação de atividades', 'Classificar os documentos referentes à programação de atividades setoriais e à programação geral de atividades da FCRB.'),
(9, '1.3.1', 'Projetos', 'Classificar os projetos desenvolvidos pela FCRB, em suas diferentes áreas de atuação, que envolvam ou não outras instituições. Abrir pasta específica para cada projeto. Os projetos que envolvam outras instituições na forma de convênios e contratos devem ser classificados em 1.6.5. Os projetos na área de informática devem ser classificados em 5.8 e /ou 5.8.1.'),
(10, '1.4', 'Relatórios de atividades', 'classificar os relatórios setoriais e gerais de atividades da FCRB'),
(11, '1.5', 'Comunicação social', NULL),
(12, '1.5.1', 'Publicidade', 'Classificar os documentos que retratem a relação da FCRB com a mídia (anúncios e entrevistas). Quanto aos documentos referentes aos eventos, projetos, etc., devem ser classificados de acordo com  seu assunto específico. E quando se tratar de divulgação da FCRB propriamente dita, classificar em 2.5.2'),
(13, '1.5.2', 'Relações Públicas', 'Classificar os documentos referentes à relação da FCRB com o público em geral, que não se enquadre em assunto específico.'),
(14, '1.5.2.1', 'Cartas de recomendação', 'Classificar a correspondência recebida e /ou expedida pela FCRB que recomenda e/ou apresenta um cidadão.'),
(15, '1.5.2.2', 'Comunicações', 'Classificar os documentos referentes à posse de cargos e atos administrativos, convites, etc., de diversas instituições. Quando for necessário classificar algum convite especial, que não se enquadre em assunto específico, adotar esta codificação.'),
(16, '1.5.2.3', 'Oferencimento. Agradecimentos. Pedidos', 'Classificar os documentos referentes a oferecimentos, agradecimentos e pedidos feitos à FCRB que não se enquadrem em assuntos específicos.'),
(17, '1.5.2.4', 'Visitas à FCRB', 'Classificar os documentos referentes às visitas realizadas à FCRB por autoridades, escolas, universidades e outras instituições.'),
(18, '1.6 ', 'Relações com outras instituições', 'Classificar os documentos referentes a programas, projetos, concursos, etc., de outras instituições apresentados à FCRB que não se enquadram em assunto específico ou nos itens abaixo.'),
(19, '1.6.1', 'Relações com o Ministério da Cultura - MINc', 'Classificar os documentos que retratem a relação da FCRB com o Ministério da Cultura - MINC desde comunicações gerais a participação em projetos e comissões do Ministério. Manter uma pasta para primeiro caso e pastas específicas para cada projeto ou comissão do MINC, como por exemplo: Política do Idoso, Política Nacional da Família.'),
(20, '1.6.2', 'Relações com o Congresso Nacional', 'Classificar requerimentos pedidos e fornecimento de informações feitos pela FCRB ao Congresso Nacional e vice-versa, que não justifiquem abertura de dossiê por assunto específico.'),
(21, '1.6.3', 'Filiação a entidades nacionas e internacionais', 'Classificar documentos referentes ao registro e participação FCRB junto a entidades nacionais e estrangeiras, tais como: ANPOCS, ABEU, etc.'),
(22, '1.6.4', 'Grupos de trabalho. Comissões', 'Classificar documentos referentes à participação da FCRB em comissões, conselhos e grupos de trabalho interinstitucionais, exceto aqueles relacionados com o MINC, que devem ser classificados em 1.6.1'),
(23, '1.6.5', 'Convênios', ' Classificar os documentos referentes aos convênios firmados entre a FFCRB e outras entidades para realização de atividades e/ou concretização de projetos. Abrir pasta específica para cada convênio.'),
(24, '1.6.6', 'Comissão Nacional de Incentivo à Cultura - CNIC', 'Classificar os documentos referentes à participação da FCRB na comissão Nacional de Incentivo à Cultura'),
(25, '1.6.7', 'Fundo Nacional de Cultura - FNC', 'Classificar os documentos referentes à participação da FCRB no Fundo Nacional de Cultura. Abrir pasta para os projetos julgados pela FCRB e outra para o Fundo Nacional de Cultura propriamente dito.'),
(26, '1.6.8', 'Clube da Cultura', 'Classificar os documentos referentes à participação da FCRB no clube da Cultura (uma associação informal que visa a promover  a Cultura)'),
(27, '1.7', 'Prestação de serviços', NULL),
(28, '1.7.1', 'Pela FCRB', 'Classificar os documentos referentes à prestação de serviços pela FCXRB na área administrativa, a outras instituições.'),
(29, '1.7.2', 'Para a FCRB', 'Classificar os documentos referentes à prestação de serviços por pessoas físicas ou jurídicas, na área administrativa, para a FCRB'),
(30, '1.8', 'Pessoal', NULL),
(31, '1.8.1', 'Legislação trabalhista. Regime Jurídico Único - RJU', 'Classificar os documentos referentes à legislação trabalhista. Regime Jurídico único dos Servidores federais e Consolidação das Leis de Trabalho -  CLT.'),
(32, '1.8.2', 'Legislação Previdenciária', 'Classificar os documentos referentes à legislação dos institutos de previdência social, exceto nos casos de descontos. Quando tratar de descontos classificar em 1.8.14.3'),
(33, '1.8.3', 'Normas de Administraççao de Pessoal', 'Classificar os documentos referentes a normas e procedimentos na área de pessoal, incluindo o Código de Ética do Servidor, Regime Disciplinar do RJU e outras instruções normativas oriundas do governo e/ou da FCRB.'),
(34, '1.8.4', 'Identificação profissional', 'Classificar os documentos de registro profissional dos servidores, registro de servidores em órgãos profissionais, na previdência social, na administração pública, etc. Ex: Registros na carteira de trabalho, nos Conselhos Regionais e Federais, emissão de carteira de identidade funcional, etc.'),
(35, '1.8.5', 'Auditorias', 'Classificar os documentos referentes aos processos de auditoria na área trabalhista.'),
(36, '1.8.6', 'Reivindicações trabalhistas', 'Classificar os documentos referentes às  reivindicações trabalhistas encaminhadas ao poder judiciário, ou não , decorrentes de dissídio coletivo greves, manifestações, etc., que envolvam questões mais amplas do que reivindicações salariais. No caso de reajustes de vencimento tos e que impliquem em medidas administrativas, classificar em 1.8.13.1'),
(37, '1.8.7', 'Relação Anual de Informaçao Salarial -  RAIS', 'Classificar a Relação Anual de informações Sociais -  RAIS.'),
(38, '1.8.8', 'Duração do trabalho', NULL),
(39, '1.8.8.1', 'Jornada de trabalho', 'Classificar os documentos referentes à jornada de trabalho: diária, semanal, mensal e anua, a solicitações, pareceres e demais documentos sobre horas extras, plantões, descanso e folgas. Inclui escalas de folgas.'),
(40, '1.8.9', 'Controle de frequência', NULL),
(41, '1.8.9.1', 'Folha de ponto', NULL),
(42, '1.8.9.2', 'Apuração de frequência', 'Classificar os documentos referentes a registro de faltas e apuração de frequência; inclui normas e procedimentos'),
(43, '1.8.10', 'Provimento. Vacância. Movimento', NULL),
(44, '1.8.10.1', 'Provimento', NULL),
(45, '1.8.10.1.1', 'Admissão', 'Classificar documentos referentes a concursos públicos de provas ou de provas e títulos, a nomeações para cargo efetivo ou de carreira, à posse , ao exercício e ao estágio probatório.'),
(46, '1.8.10.1.2', 'Estabilidade', 'Classificar documentos referentes à estabilidade no serviço público. Incluem-se as alterações e legislação.'),
(47, '1.8.10.1.3', 'Transferência', 'Classificar documentos sobre a passagem de servidor de cargo efetivo para outro de igual denominação, pertencente a quadro de pessoal diverso, de órgão ou instituição do mesmo Poder.'),
(48, '1.8.10.1.4', 'Readaptação. Recondução', 'Classificar documentos referentes ao retorno à atividade de servidor aposentado por invalidez, quando através de junta médica oficial forem considerados insubsistentes os motivos de aposentadoria (reversão) e a investidura de servidor em cargo de atribuições e responsabilidades compatíveis com a limitação que tenha sofrido em sua capacidade física ou mental atestada por inspeção médica ( readaptação). Abrir pasta para Readaptação e outra para Reversão, sob a mesma codificação.'),
(49, '1.8.10.1.5', 'Reintegração. Recondução', 'Classificar os documentos referentes à reinvestidura de servidor no cargo anteriormente ocupado ou em cargo resultante de sua transformação uma vez invalidada sua demissão por decisão administrativa ou judicial ( reintegração) e documentos referentes ao retorno de servidor estável ao cargo anteriormente ocupado, por inabilitação em estágio probatório relativo a outro cargo ou reintegração do anterior ocupante ( recondução). Inclui a readmissão de servidores anistiados, assunto da Lei 8.878 de 11 de maio de 1994. Abrir pasta para reintegração e para '),
(50, '1.8.10.1.6', 'Disponibilidade. Aproveitamento', 'Classificar os documentos referentes à disponibilidade e retorno de servidor à atividade, bem como o aproveitamento de servidores. Abrir pasta para Disponibilidade e outra para Aproveitamento quando o volume de documentos justificar.'),
(51, '1.8.10.2', 'Vacância', NULL),
(52, '1.8.10.2.1', 'Exoneração de cargo efetivo', 'Classificar os documentos referentes à exoneração a pedido do servidor da administração ou a juízo de autoridade competente. Inclui PDV ( Plano de Demissão Voluntária)'),
(53, '1.8.10.2.2', 'Exoneração de cargo em comissão', 'Classificar os documentos referentes à exoneração de cargo de confiança, a juízo de autoridade competente e a pedido do servidor.'),
(54, '1.8.10.2.3', 'Abandono de emprego', 'Classificar os documentos sobre o afastamento definitivo de servidor por não comparecer ao emprego caracterizando abandono do mesmo'),
(55, '1.8.10.3', 'Remoção', 'Classificar  os documentos referentes ao deslocamento de servidor, a pedido ou de ofício, no mesmo quadro, com ou sem mudança de sede. '),
(56, '1.8.10.4', 'Redistribuição', 'Classificar os documentos referentes ao deslocamento de servidor, om respectivo cargo, para quadro de pessoal de outro órgão,  ou entidade do mesmo Poder, cujos planos de cargos e vencimentos sejam idênticos.'),
(57, '1.8.11', 'Quadros de servidores', 'Classificar os documentos referentes à lotação de servidor na FCRB. Ex.: Quadro de Lotação Ideal.'),
(58, '1.8.11.1', 'Cadastro', 'Classificar  os documentos referentes à relação de funcionários, quadro demonstrativo de servidor e dados cadastrais como endereços, telefones, etc. de servidor. Inclui relação e dados referentes aos dependentes do servidor.'),
(59, '1.8.11.2', 'Plano de classificação de cargos e salários', 'Classificar os documentos referentes às carreiras, cargos e respectivos salários de servidores; inclui enquadramento de servidores, transformações e extinção de cargos.'),
(60, '1.8.11.3', 'Promoçao. Avaliação de desempenho', 'Classificar os documentos  referentes à promoção por merecimento e/ou antiguidade. Inclui as avaliações de desempenho de servidor. Abrir pasta para Merecimento para Antiguidade, e para os formulários das avaliações de desempenho.'),
(61, '1.8.11.4', 'Assentamentos funcionais', 'Classificar os documentos que constituem as pastas funcionais dos servidores. Inclui as fichas de registros de servidores as pastas funcionais dos servidores na ativa são arquivadas no Setor de Pessoal.'),
(62, '1.8.11.5', 'Acumulação de cargos', 'Classificar os documentos referentes à acumulação de cargos no magistério com cargos técnicos ou científicos e de dois cargos para magistério com cargos técnicos ou científicos e de dois cargos para magistério e médico. Inclui as permissões e proibições quando ocorrer acumulação de cargos efetivos e de comissão.'),
(63, '1.8.11.6', 'Medida administrativa e disciplinar', 'Classificar os documentos  referentes a sindicâncias, advertências, afastamentos preventivos, julgamentos de processos administrativos, suspensões. Inclui processos disciplinares e inquéritos administrativos na área de pessoal. Os inquéritos sobre outros assuntos receberão o código de seu assunto específico.'),
(64, '1.8.12', 'Quadro suplementar', 'Classificar os documentos referentes à contratação e manutenção de funcionários não pertencentes ao quadro da FCRB que desempenhem, temporariamente, atividades na instituição.'),
(65, '1.8.12.1', 'Estagiário', 'Classificar documentos referentes à seleção e contratação de estagiários. Cada estagiário receberá pasta específica.'),
(66, '1.8.12.2', 'Autônomo', 'Classificar documentos referentes à seleção, contratação de autônomos ou profissionais liberais, sem vínculo empregatício. Cada profissional receberá pasta específica.'),
(67, '1.8.13', 'Direitos. Vantagens. Benefícios', NULL),
(68, '1.8.13.1', 'Vencimentos e remuneração. Folha de pagamento de pessoal', 'Classificar os documentos referentes à retribuição pecuniária pelo exercício de cargo público (vencimento), ao vencimento acrescido e vantagens pecuniárias permanentes, e às folhas de pagamento. Inclui demonstrativo da despesas realizada com pessoal ( fichas financeiras), relação bancária de consignações, relação financeira de pagamento a pensionista, listagem por faixa  salarial de salários, etc., e ao que se referir ao Sistema Integrado de Administração de Recursos Humanos - SIAPE. Classificar também os documentos sobre medidas administrativas que'),
(69, '1.8.13.2', 'Vantagens', 'Classificar as gratificações referentes ao estímulo à pesquisa, mestrado, doutorado, GAE e /ou outras vantagens (indenizações, gratificações e adicionais) não especificados no RJU.'),
(70, '1.8.13.2.1', 'Ajuda de custo', 'Classificar os documentos referentes ao pagamento e restituições de indenizações de despesas de instalação de servidor que passa a ter exercício em nova sede implicando mudança de domicílio ( permanente). Ex: Despesas de transporte do servidor e família do servidor que falecer em nova sede, para transporte do corpo para o local de origem, etc.'),
(71, '1.8.13.2.2', 'Diárias. Passagens', 'Classificar os documentos referentes ao pagamento de passagens, diárias para cobrir despesas com pousada, transporte e alimentação para o servidor. Abrir pasta para Diárias e Passagens.'),
(72, '1.8.13.2.3', 'Transporte', 'Classificar os documentos referentes ao ressarcimento de despesas com utilização de meio próprio de locomoção para execução de serviços externos.'),
(73, '1.8.13.2.4', 'Gratificação por Exercício de Função de Direção, Chefia ou Assessoramento. Substituição', 'Classificar os documentos referentes às gratificações por exercício de função de direção, chefia ou assessoramento e às substituições indicadas por regimento interno  e/ ou designadas por autoridade competente. Inclui documentos sobre posse em cargo de confiança, números de cargos de confiança e outros de caráter geral que envolvam mais de um assunto específico sobre a matéria Ex.: Portarias, Medidas Provisórias sobre nomeação, exoneração e substituição ( um único documento tratando dos três assuntos).'),
(74, '1.8.13.2.5', 'Gratificação Natalina', 'Classificar os documentos referentes à remuneração de 1/12 ( um doze avos) por mês de exercício o ano, paga ao servidor.'),
(75, '1.8.13.2.6', 'Adicional por tempo de serviço', 'Classificar os documentos referentes ao pagamento de percentual por tempo de serviço público efetivo. Ex: Anuênios, biênios, triênios, quinquênios etc.'),
(76, '1.8.13.2.7', 'Adicionais de insalubridade, periculosidade ou atividade penosa', 'Classificar documentos referentes às atividades e pagamento de adicionais para servidores que desenvolvem atividades em locais insalubres ou em contato com substâncias tóxicas, com risco de vida, etc. Inclui requisições, visitas de especialistas, laudos , etc.'),
(77, '1.8.13.2.8', 'Adicional por serviço extraordinário. Adicional noturno', 'Classificar os documentos relativos à remuneração de acréscimo de 50% em relação à hora normal de trabalho em caso de situações excepcionais ( serviço extraordinário) e ao serviço noturno prestado em horário entre 22 horas de um dia e 5 horas do dia seguinte. Abrir pasta para Adicional por serviço Extraordinário e outra para Adicional Noturno.'),
(78, '1.8.13.2.9', 'Adicional de férias', 'Classificar os documentos referentes ao pagamento de 1/3 ( um terço) da remuneração do período das férias.'),
(79, '1.8.13.3', 'Férias', 'Classificar os documentos referentes a férias. Inclui solicitações, alterações, pagamento, conversão em abono pecuniário, etc.'),
(80, '1.8.13.4', 'Licenças', 'Classificar os documentos referentes às licenças permitidas ao servidor como vantagem ou benefício. Os documentos de caráter pessoal após tramitação serão arquivados na pasta funcional do servidor. Para cada tipo de licença será aberta uma pasta sob codificação específica , (quando o acumulo de documentos justificar) qual seja: 1.8.13.4.1 - por motivo de doença em pessoa da família; 18.13.4.2 - por motivo de afastamento do cônjuge; 1.8.13.4.3 - Para serviço militar; 1.8.13.4.4 - Para atividade política; 1.8.13.4.5 - Prêmio por assiduidade; 1.8.13.4.'),
(81, '1.8.13.5', 'Afastamento para servir a outro órgão ou entidade', 'Classificar os documentos referentes à cessão de servidor para ter exercício em outro órgão dos Poderes da União, dos estados ou Distrito Federal e de municípios para cargo em comissão ou função de confiança e/ou casos previstos em leis específicas.'),
(82, '1.8.13.6', 'Afastamento para exercício de mandato eletivo', 'Classificar os documentos referentes a exercício de mandato  eletivo seja federal, estadual, distrital e municipal.'),
(83, '1.8.13.7', 'Afastamento para estudo no Brasil', 'Classificar os documentos referentes à ausência de servidor do local de trabalho para estudo no Brasil, treinamento, aperfeiçoamento profissional, etc. Inclui autorização , pedidos de empenho, de bolsas, relatórios, etc.'),
(84, '1.8.13.8', 'Afastamento para estudo no exterior', 'Classificar os documentos referentes à ausência de servidor do local de trabalho para estudo no exterior. Inclui autorização, pedidos de empenho, de bolsas, relatórios, etc.'),
(85, '1.8.13.9', 'Afastamento para missão no exterior e no Brasil', 'Classificar os documentos referentes à ausência de servidor do local de trabalho para cumprir missão oficial no exterior e no Brasil, com ou sem remuneração. Abrir pasta para Exterior e para Brasil'),
(86, '1.8.13.10', 'Concessões', 'Classificar os documentos referentes à ausência de servidor do serviço. Inclui a convocação do TER para trabalhar em eleições. Abrir pasta específica para cada tipo de concessão, quando o acúmulo de documentos justificar, obedecendo à seguinte codificação: 1.8.13.10.1 - Doação de sangue; 1.8.13.10.2 - Alistamento como Eleitor; 1.8.13.10.3 - Casamento; 1.8.13.10.4 - Falecimento; 1.8.13.10.5 - Horário Especial; 1.8.13.101.6 - Matrícula em Instituição de Ensino.'),
(87, '1.8.13.11', 'Benefícios', NULL),
(88, '1.8.13.11.1', 'Aposentadoria', 'Classificar os documentos referentes à aposentadoria por invalidez, por compulsória (aos setenta anos de idade) e voluntária  (por tempo de serviço e proporcional ao tempo de serviço)'),
(89, '1.8.13.11.2', 'Auxilio natalidade', 'Classificar documentos referentes ao pagamento de menor vencimento dentro do serviço público a servidor em  caso de nascimento de filho, inclusive natimorto.'),
(90, '1.8.13.11.3', 'Salário-família', 'Classificar os documentos referentes ao pagamento devido ao servidor por dependentes econômicos'),
(91, '1.8.13.11.4', 'Auxílio pré-escola', 'Classificar os documentos referentes ao pagamento devido ao servidor por filho (s) em idade pré - escolar.'),
(92, '1.8.13.11.5', 'Auxílio Refeição', 'Classificar os documentos referentes ao auxílios, em forma de ticket, para alimentação, utilizado em supermercados, açougues, etc. e para refeição utilizado em restaurantes e em lanches. Inclui o termo de opção e normas. Abrir pasta específica para Auxílio Refeição e para Auxílio Alimentação e para cada uma destas, abrir pasta específica para Recibos e Faturas e para Termo de Opção.'),
(93, '1.8.13.11.6', 'Auxílio funeral. Auxilio reclusão', 'Classificar os documentos referentes ao pagamento à família de servidor falecido na atividade, inclusive no exterior, ou aposentado, equivalente a um mês de remuneração e provento. Inclui documentos referentes ao pagamento de parte da remuneração do servidor à família, quando este for afastado por motivo de prisão e /ou condenação. Abrir pasta específica para Auxílio Funeral e para Auxílio Reclusão.'),
(94, '1.8.13.11.7', 'Auxílio transporte', 'Classificar os documentos referentes ao fornecimento de auxílio transporte. Inclui normas, legislação, etc.'),
(95, '1.8.13.11.8', 'Assistência médica complementar', 'Classificar os documentos referentes a pano de saúde que atenda aos servidores. Inclui normas, legislação, termos de opção, etc. Abrir pasta específica para Recibos e Faturas e para Termo de Opção.'),
(96, '1.8.13.11.9', 'Pensão', 'Classificar os documentos referentes aos direitos e pagamentos  de pensão alimentícia e pensão a cônjuge e / ou aos dependentes econômicos de servidor'),
(97, '1.8.14', 'Descontos', NULL),
(98, '1.8.14.1', 'Imposto de Renda', 'Classificar os documentos sobre normas e legislação referentes a imposto de renda. Inclui as solicitações de cópias de declaração de renda e recibo da entrega do mesmo'),
(99, '1.8.14.2', 'Imposto Sindical', 'Classificar os documentos sobre normas e legislação sobre imposto sindical que não se refira ao SINTRASEF.'),
(100, '1.8.14.3', 'INSS. PSSS', 'Classificar os documentos sobre normas e legislação referente aos descontos do Instituto Nacional de Seguridade Social e ao Plano de Seguridade Social do Servidor.'),
(101, '1.8.15', 'Organização sindical', 'Classificar os documentos referentes à filiação , contribuição sindical, normas, SINTRASEF, etc.'),
(102, '1.8.16', 'Segurança e Medicina do Trabalho', 'Classificar os documentos referentes à segurança e medicina do trabalho, não contemplados em Exame médico e em Acidente de trabalho.'),
(103, '1.8.16.1', 'Exame médico', 'Classificar os documentos referentes à avaliação do estado de saúde física e mental dos servidores, no local de trabalho.'),
(104, '1.8.16.2', 'Acidente de trabalho', 'Classificar os documentos referentes às perícias, relatórios de acidentes do trabalho, etc. Inclui os documentos sobre seguros. O que for referente às licenças deve ser classificado sob a codificação específica adotada para Licenças.'),
(105, '1.8.17', 'Currículos', 'Classificar os dados cadastrais de pessoas que não pertençam ao quadro de servidores'),
(106, '1.8.18', 'Solicitação de funcionário para serviço interno e externo', 'Classificar os documentos referentes à solicitação de servidor para realização de serviços externos ou internos que não possam ser classificados pelo assunto específico. No caso de ida de servidor para pegar número de ISBN na Biblioteca Nacional, classificar  em Editoração.'),
(107, '1.8.19', 'PASEP', 'Classificar os documentos referentes à contribuição da FCR para PASEP. Inclui as modificações de PIS para PASEP.'),
(108, '1.9', 'Imóveis', 'Classificar os documentos referentes aos bens imóveis e ao patrimônio tombado, exceto os acervos documentais. Os documentos referentes aos acervos arquivísticos, bibliográficos e museológicos recebem codificação específica dentro da classe 5.'),
(109, '1.9.1', 'Escrituras. Tombamento', 'Classificar os documentos referentes à situação jurídica dos imóveis e tombamento pelo Patrimônio Histórico. Ex: Certidões, escrituras, etc.'),
(110, '1.9.2', 'Operações imobiliárias', 'Classificar os documentos referentes à compra, arrendamento, locação, permuta, alienação, desapropriação e doação de bens imóveis da FCRB e /ou para a FCRB. Abrir pasta para cada modalidade de operação imobiliária. Ex.: Imóvel, Desapropriação. Terreno, Arrendamento.'),
(111, '1.9.3', 'Desenhos e projetos (somente para documentos gráficos)', '(Somente para Documentos Gráficos) Classificar as plantas, projetos, croquis (documentos não textuais) que retratem as edificações e ambiência ( jardins, muros, etc.) da FCRB. Estes documentos se encontram arquivados na mapoteca.'),
(112, '1.9.3.1', 'Museu', NULL),
(113, '1.9.3.1.1', 'Levantamento geral', 'Classificar plantas gerais , fachadas, cortes do Museu, Plantas de instalações prediais ( elétricas, hidráulicas e de esgoto), etc.'),
(114, '1.9.3.1.2', 'Projetos de restauração de bens imóveis', 'Classificar os levantamentos parciais, croquis, detalhes de esquadrias referentes aos projetos de restauração de bens imóveis.'),
(115, '1.9.3.2', 'Jardim', NULL),
(116, '1.9.3.2.1', 'Sistema elétrico de iluminação', 'Classificar as pranchas de desenhos da General Electric e /ou outros projetos de restauração de redes elétricas e /ou iluminação do jardim.'),
(117, '1.9.3.2.2', 'Sistema hidráulico e de irrigação', 'Classificar as pranchas de desenhos e /ou outros projetos de restauração da rede de água instalada no jardim.'),
(118, '1.9.3.3', 'LAMIC (laboratório de Microfilmagem)', 'Classificar o projeto de reforma da construção, ampliação, etc. do Laboratório de Microfilmagem  - LAMIC'),
(119, '1.9.3.4', 'Terreno 130', 'Classificar os projetos da construção do almoxarifado, o prédio anexo II, e os desenhos referentes às construções no terreno na Rua São Clemente número 130.'),
(120, '1.9.3.5', 'Espaço Américo Jacobina Lacombe', NULL),
(121, '1.9.3.5.1', 'Projeto inicial', 'Classificar croquis, estudos preliminares, anteprojetos, etc.., referentes à construção do prédio na Rua Assunção número 520.'),
(122, '1.9.3.5.2', 'Projeto executivo', 'Classificar pranchas de desenhos da obra de construção propriamente dita do prédio na Rua Assunção número 520. Inclui as plantas da COBE.'),
(123, '1.9.3.5.2.1', 'Arquitetura', 'Classificar os documentos de arquitetura referentes ao prédio na Rua Assunção número 520'),
(124, '1.9.3.5.2.2', 'Estrutura', 'Classificar os desenhos de estrutura de concreto armado referentes ao prédio na Rua Assunção número 520.'),
(125, '1.9.3.5.2.3', 'Instalações prediais', 'Classificar os desenhos das redes elétricas, hidráulicas, de esgoto, de telefonia, etc. referentes ao prédio na Rua Assunção número 520.'),
(126, '1.9.3.5.2.4', 'Instalações especiais', 'Classificar os desenhos do sistema de alarme e outros específicos referentes ao prédio na Rua Assunção número 520. No caso das instalações especiais do auditório classificar em 1.9.3.5.3'),
(127, '1.9.3.5.2.5', 'Ocupação', 'Classificar os layouts das áreas privativas do prédio na Rua Assunção número 520.'),
(128, '19.3.5.3', 'Auditório', 'Classificar os desenhos referentes a todos os projetos sobre o auditório tais como: arquitetura, estrutura, instalações especiais, de sistemas de audiovisual, de ar condicionado, acústica, elétrica, etc.'),
(129, '1.9.4', 'Serviços básicos', NULL),
(130, '1.9.4.1', 'Instalações elétricas. Iluminação', 'Classificar os documentos referentes à instalação, manutenção, pagamento dos serviços de fornecimento de energia elétrica e de iluminação.'),
(131, '1.9.4.2', 'Instalações hidro-sanitárias e de gás', 'Classificar os documentos referentes à instalação, manutenção, conservação, pagamento dos serviços de fornecimento de água, esgoto e gás.'),
(132, '1.9.4.3', 'Telefones. Fax. Telex. Internet', 'Classificar os documentos referentes à aquisição, instalação, manutenção, transferência, registro e pagamento de serviços de telefones, faz e telex. Abrir pasta Telefones, para Telex, para Fax e para Internet, quando o volume de documentos justificar.'),
(133, '1.9.4.4', 'Elevadores', 'Classificar os documentos referentes à aquisição e manutenção dos elevadores que atendem à FCRB.'),
(134, '1.9.4.5', 'Ar refrigerado', 'Classificar os documentos referentes à instalação e manutenção de ar refrigerado.'),
(135, '1.9.4.6', 'Imunização. Limpeza', 'Classificar os documentos referentes ao controle biológico e limpeza dos edifícios e jardim pertencentes à FCRB. Abrir pasta específica para cada edificação no caso de limpeza e para controle biológico ( dedetização, descupinização, desratização, etc.). Ex.: Museu, Limpeza; Espaço Américo Jacobina Lacombe, Limpeza.'),
(136, '1.9.5', 'Obras de conservação e restauração', 'classificar os documentos referentes aos trabalhos de recuperação, reformas e restauração dos bens culturais. Ex.: Museu, Obras de Conservação e Restauração; Jardim, Obras de Conservação e Restauração.'),
(137, '1.9.6', 'Obras de manutenção', 'Classificar os documentos referentes às obras civis gerais e pequenos reparos. Inclui troca de azulejos de banheiros, reparos de revestimentos, troca de tapetes, troca de divisórias, etc. Ex.: Edifício Américo Jacobina Lacombe, Obras de Manutenção.'),
(138, '1.9.7', 'Áreas', NULL),
(139, '1.9.7.1', 'Área privativa', 'Classificar os documentos referentes às áreas de trabalho'),
(140, '1.9.7.1.1', 'Ocupação', 'Classificar os documentos referentes à distribuição de espaços entre os setores da FCRB, à elaboração de layouts para os setores, alteração no uso dos espaços, etc.'),
(141, '1.9.7.2', 'Área de uso comum', 'Classificar os documentos referentes às áreas comuns tais como : Hall, saguão, escada, banheiros, etc.'),
(142, '1.9.7.3', 'Área cultural', 'Classificar os documentos referentes ao auditório, ao salão de exposições, Biblioteca, Arquivo, Arquivo- Museu de Literatura, Museu e jardim.'),
(143, '1.9.7.3.1', 'Cessão e utilização', 'Classificar os documentos referentes à cessão, interdição e preparação de dependências da FCRB para realização de eventos, filmagens, cursos, etc.'),
(144, '1.9.7.4', 'Acréscimo de áreas', 'Classificar os documentos referentes às expansões da FCRB tais como : mudanças, construção de prédios, etc.'),
(145, '1.9.8', 'Estacionamento', 'Classificar os documentos referentes ao controle de uso e de pagamento, por parte dos servidores da FCRB do estacionamento de veículos que funciona em terreno da FCRB.'),
(146, '1.9.9', 'Segurança ', 'Classificar os documentos referentes às medidas de segurança como troca de fechaduras, vedação de janelas, fechamento de portão ou portaria, etc.'),
(147, '1.9.9.1', 'Incêndio ', 'Classificar os documentos referentes à prevenção contra incêndios, instalação e manutenção de extintores, e equipamento de detenção e combate a incêndio.'),
(148, '1.9.9.2', 'Furto. Arrombamento. Extravio', 'Classificar os documentos referentes aos furtos, arrombamentos, extravios, sinistros de bens e materiais da FCRB. Inclui as tentativas de furtos e perícias decorrentes.'),
(149, '1.9.9.3', 'Seguro', 'Classificar os documentos referentes aos contratos de seguros em casos de incêndio furos, arrombamentos, extravios, etc.'),
(150, '1.9.9.4', 'Vigilância', 'Classificar os documentos referentes ao serviço da guarda municipal e /ou equipes de segurança contratados para garantir e proteger o patrimônio e o material da FCRB.'),
(151, '1.9.9.5', 'Acesso fora do expediente', 'Classificar os documentos referentes à entrada de pessoas nos edifícios da FCRB fora do horário de expediente.'),
(152, '1.9.9.6', 'Controle de portaria', 'Classificar os documentos referentes ao controle de entrada de pessoas nas dependências da FCRB.'),
(153, '1.9.10', 'Moradia de servidor', 'Classificar os documentos referentes ao uso de dependência da FCRB para fins residenciais de servidor.'),
(154, '1.10', 'Veículos', NULL),
(155, '1.10.1', 'Aquisição. Locação', 'Classificar os documentos referentes à compra de viaturas, doação de veículos feitas para a FCRB a permuta de veículos com outras instituições na pasta Aquisição. Classificar os documentos referentes ao aluguel de veículos pela FCRB na pasta Locação.'),
(156, '1.10.2', 'Alienação. Tombamento', 'Classificar os documentos referentes à transferência de posse e arrolamento de veículos. Abrir pasta para Alienação e outra para Tombamento.'),
(157, '1.10.3', 'Manutenção', 'Classificar os documentos referentes à limpeza, reparos, revisão mecânicas dos veículos, etc.'),
(158, '1.10.4', 'Acidente. Seguro', 'Classificar os documentos referentes a batidas, atropelamentos, etc. ocorridos com os veículos na pasta Acidentes e os contratos e utilização de seguros de veículos na pasta Seguros.'),
(159, '1.10.5', 'Abastecimento', 'Classificar os documentos referentes ao abastecimento dos veículos.'),
(160, '1.10.6', 'Infrações e multas de trânsito', 'Classificar os documentos referentes a infrações cometidas no trânsito com os veículos e multas decorrentes das mesmas.'),
(161, '1.10.7', 'Registros. Emplacamento. Cadastro', 'Classificar os documentos referentes à inscrição dos veículos junto aos órgãos competentes, inclusive junto ao Ministério e também referentes ao pagamento do IPVA. Na pasta Registro classificar os documentos referentes a inscrição e regulamentação dos veículos, na pasta Emplacamento arquivar os documentos referentes a emplacamento, mudança de placa e na pasta Cadastro arquivar os documentos referentes ao censo de carros oficiais.'),
(162, '1.10.8', 'Controle', NULL),
(163, '1.10.8.1', 'Requisição', 'Classificar os documentos referentes à solicitação (autorizada ou não), bem como demais procedimentos administrativos para o uso de veículos oficiais durante o expediente.'),
(164, '1.10.8.2', 'Autorização para o uso fora do horário de expediente', 'Classificar os documentos referentes  à solicitação (autorizada ou não) do uso de veículos oficiais fora do horário do expediente.'),
(165, '1.11', 'Material', NULL),
(166, '1.11.1', 'Cadastro de fornecedor. Catálogo. Tabela de preços', 'Classificar os documentos referentes ao cadastramento de fornecedores, aos processos de cadastramento, às listagens e/ou catálogos de fornecedores, documentos de firmas, folders promocionais, tabelas de preços materiais, etc. Abrir pasta para Material Permanente e para Material de Consumo, quando necessário. Ex: Material de consumo, Catálogos; Material Permanente, Catálogos.'),
(167, '1.11.2', 'Padronização, especificação e codificação', 'Classificar os documentos referentes às instruções e/ou instrumentos que definam a padronização de materiais de consumo e/ou permanente, suas especificações e códigos.'),
(168, '1.11.3', 'Inventário patrimonial e controle de estoque', 'Classificar os inventários dos bens patrimoniais e do material de consumo da FCRB. Inclui os instrumentos de controle de estoque.'),
(169, '1.11.4', 'Material de consumo', 'Classificar o material utilizado pela administração que não receba número de patrimônio. Abrir pasta para cada tipo de material quando o volume de documentos e a constância da utilização dos mesmos justificar. EX: Material de papelaria; Material gráfico; Uniformes, etc.'),
(170, '1.11.4.1', 'Aquisição', 'Classificar os documentos referentes à compra e/ou doação de material de consumo para a FCRB. Inclui relação de compras.'),
(171, '1.11.4.2', 'Distribuição', 'Classificar os documentos referentes à entrega de material de consumo para os setores da FCRB. EX: Instruções, definições de dias para solicitações, etc.'),
(172, '1.11.4.2.1', 'Requisição de material', 'Classificar os documentos referentes às solicitações referentes da FCRB de material de consumo, a disponibilidade ou não de verba, à autorização de servidores para requisitar material e recebê-lo, etc.'),
(173, '1.11.4.2.2', 'Cessão', 'Classificar os documentos referentes à transferência de direitos, posse ou propriedade de determinado material de consumo para e/ou pela FCRB e entre outros setores da instituição.'),
(174, '1.11.4.3', 'Empréstimo', 'Classificar os documentos referentes ao uso de material de consumo de propriedade de outra instituição pela FCRB, ao uso de material de consumo de propriedade da FCRB por outra instituição, bem como ao uso de material de consumo de um setor da FCRB por outro.'),
(175, '1.11.4.4', 'Permuta', 'Classificar os documentos referentes à troca de materiais de consumo entra a FCRB e outra instituição e/ou entre setores da FCRB.'),
(176, '1.11.5', 'Material permanente', 'Classificar os documentos referentes a aparelhos, bebedouros, equipamentos, ferramentas, máquinas, mobiliário, etc. que recebam número de patrimônio da FCRB.'),
(177, '1.11.5.1', 'Aquisição', 'Classificar os documentos referentes à compra de material permanente feita pela FCRB e/ou doação de bens patrimoniais feitas à FCRB. Inclui relação de compras.'),
(178, '1.11.5.2', 'Distribuição', 'Classificar os documentos referentes à entrega de bens patrimoniais aos setores da FCRB.'),
(179, '1.11.5.2.1', 'Requisição de material', NULL),
(180, '1.11.5.2.2', 'Termo de responsabilidade', 'Classificar os documentos referentes à descrição e número do material permanente  sob a responsabilidade de algum servidor. Inclui comunicações internas passando a responsabilidade para outro servidor, as fichas de material e de assinaturas, etc.'),
(181, '1.11.5.2.3', 'Depósito', 'Classificar os documentos referentes à colocação de bens patrimoniais que não mais utilizados na área de depósito.'),
(182, '1.11.5.3', 'Alienação', 'Classificar os documentos referentes à transferência de domínio material permanente.'),
(183, '1.11.5.3.1', 'Venda', 'Classificar os documentos referentes à venda de bens materiais alienados da FCRB.'),
(184, '1.11.5.3.2', 'Cessão', 'Classificar os documentos referentes à transferência de direitos, posse ou propriedade de determinado material permanente para e/ou pela FCRB ou entre os setores da instituição.'),
(185, '1.11.5.3.3', 'Permuta', 'Classificar os documentos referentes à troca  de material permanente entre a FCRB e outra instituição e/ou entre os setores da própria FCRB.'),
(186, '1.11.5.4', 'Empréstimo', 'Classificar os documentos referentes ao ato de outra instituição confiar a FCRB, ou ao fato de a FCRB confiar a outra instituição ou ao ato de um setor da FCRB confiara a outro setor, temporariamente, o uso de material permanente.'),
(187, '1.11.5.5', 'Locação', 'Classificar os documentos referentes ao aluguel de material permanente da FCRB e/ou pela FCRB. No caso de locação do equipamento eletrostático arquivar em 1.20.2.'),
(188, '1.11.5.6', 'Manutenção', 'Classificar os documentos referentes à recuperação, conservação, revisão e limpeza do material permanente da FCRB.'),
(189, '1.11.6', 'Bens importados', 'Classificar os documentos referentes à importação de bens patrimoniais ou de consumo pela FCRB.'),
(190, '1.11.7', 'Certficado de regularidade jurídico-fiscal. Atestado de capacidade física', 'Classificar os atestados de cumprimento de atividades pelas empresas prestadoras de serviços e fornecedoras da FCRB na pasta Atestado de Capacidade Técnica. Classificar os atestados de regularidade jurídico-fiscal de empresas que querem constar do cadastro de fornecedores da FCRB e outros documentos referentes ao assunto, na pasta Certificado de Regularidade Jurídico-Fiscal.'),
(191, '1.12', 'Gestão e finanças', NULL),
(192, '1.12.1', 'Auditorias', 'Classificar os documentos referentes ao processo de auditoria nas contas e gestão da FCRB.'),
(193, '1.12.2', 'Sistema Integrado de Administração Financeira do Governo Federal - SIAFI', 'Classificar os documentos referentes ao SIAFI, que objetiva controlar desde a dotação orçamentária até o saldo de execução financeira. Inclui os documentos referentes à representação da FCRB junto ao SIAFI.'),
(194, '1.12.3', 'Sistema Integrado de Dados Orçamentários - SIDOR', 'Classificar os documentos referentes ao SIDOR, que objetiva controlar desde a proposta orçamentária até a dotação orçamentária. '),
(195, '1.13', 'Orçamento e finanças', NULL),
(196, '1.13.1', 'Proposta orçamentária', 'Classificar a proposta de orçamento apresentada ao governo federal, anualmente, os créditos adicionais – autorização de despesas não computadas ou insuficientemente dotadas na Lei de Orçamento. Podem ser: Crédito Suplementar (reforço na dotação orçamentária); Crédito Especial (reforço para as despesas para as quais não haja dotação orçamentária específica) e Crédito Extraordinário (reforço para despesas imprevisíveis e urgentes como decorrentes da guerra, comoção interna ou calamidade pública). Inclui o Quadro de Detalhamento de Solicitação – QDS, o'),
(197, '1.13.2', 'Execução orçamentária', 'Classificar os documentos referentes ao empenho da dotação orçamentária'),
(198, '1.13.2.1', 'Controle orçamentário', 'Classificar os documentos referentes à relação  entre  a dotação orçamentária, a execução orçamentária, e o saldo da dotação orçamentária.'),
(199, '1.13.3', 'Recursos orçamentários', 'Classificar os documentos referentes ao orçamento para ser empenhado.'),
(200, '1.13.4', 'Recursos de convênios', 'Classificar os documentos referentes à celebração de convênios entre a FCRB e outras instituições visando a captação de recursos. Inclui propostas, dotação e execução orçamentárias próprias, bem como prestação de contas específicas.'),
(201, '1.13.5', 'Proposta financeira', 'Classificar os documentos referentes ao planejamento mensal dos gastos da FCRB.'),
(202, '1.13.6', 'Liberaçao de verba', 'Classificar os documentos referentes aos recursos liberados pelo governo federal para a FCRB, previsto no orçamento.'),
(203, '1.13.7', 'Receita', 'Classificar os documentos referentes aos recursos econômicos e financeiros previstos no orçamento do Estado e arrecadados para fazer face às despesas.'),
(204, '1.13.7.1', 'Aplicação financeira', 'Classificar os documentos referentes à aplicação dos recursos próprios em caderneta de poupança.'),
(205, '1.13.7.2', 'Recursos próprios', 'Classificar os documentos referentes à arrecadação da própria FCRB (com venda de publicações, de ingressos, aluguel de auditório, etc.).'),
(206, '1.13.8', 'Despesas', NULL),
(207, '1.13.8.1', 'Despesas de exercícios anteriores', 'Classificar os documentos referentes às dívidas antigas não pagas no próprio exercício. São inscritas como despesas de exercícios anteriores as despesas de exercícios encerrados, para os quais o orçamento respectivo consigna crédito próprio com saldo suficiente para atendê-las, que não se tenham processado na época própria, compromisso decorrentes de obrigação de pagamento criada em virtude de lei e reconhecidos após encerramento de exercício.'),
(208, '1.13.8.2', 'Suprimento de fundos', 'Classificar os documentos referentes às despesas miúdas de passagens de ônibus, metrô, tiragem de xerox fora da FCRB, etc.'),
(209, '1.13.8.3', 'Resto a pagar', 'Classificar os documentos referentes à despesas líquidas e não pagas, ou não liquidadas, desde que o vigente prazo para cumprimento de obrigação assumida pelo credor, indicado na nota de empenho,  ou vencido o prazo para cumprimento da obrigação assumida pelo credor mas que esteja em curso a liquidação da despesa ou seja da Administração exigir o cumprimento da obrigação do credor, ou se destinem a atender transferências para as instituições públicas ou privadas, e que correspondam aos compromissos assumidos no exterior. Em suma, despesas previstas '),
(210, '1.13.8.4', 'Acompanhamento de Desembolso Mensal com Pessoal e Força de Trabalho ADMP', 'Classificar os documentos referentes à despesa pessoal e força de trabalho mensais. Inclui cópia de formulário ADMP.'),
(211, '1.13.9', 'Prestação de contas  ', NULL),
(212, '1.13.9.1', 'Exercício', 'Classificar os documentos referentes à demonstração das contas da FCRB, ou seja, à apresentação da prestação de contas do total dos recursos recebidos. Inclui normas para fechamento do exercício, instrução para o preenchimento de formulários, cronograma e balanço anual.'),
(213, '1.13.9.2', 'Conselho Fiscal', 'Classificar os documentos referentes às relações da FCRB com os três conselheiros a cerca das contas da instituição e os balancetes (mensais).'),
(214, '1.13.9.3', 'Rol dos responsáveis', 'Classificar os documentos referentes à responsabilidade de gerir as contas da FCRB, pela Presidência, Direção Executiva e pela Diretoria de Administração, bem como pelos substitutos.'),
(215, '1.14', 'Operações bancárias', NULL),
(216, '1.14.1', 'Conta-Salário', 'Classificar os documentos referentes à abertura, fechamento e manutenção de conta-salário de servidor.'),
(217, '1.14.2', 'Contas -Correntes', 'Classificar os documentos referentes à conta para pequenas despesas (tipo C) e à Conta Única do Tesouro Nacional que tem por finalidade acolher as disponibilidades financeiras da União a serem movimentadas pelas Unidades Gestoras-UGS da Administração Federal, direta e indireta, participante do Sistema Integrado de Administração Financeira – SIAFI.'),
(218, '1.14.2.1', 'Transferências', 'Classificar os documentos referentes à passagem de recursos da conta tipo C para a conta única de Tesouro Nacional. Classificar as contas, faturas, etc. pagas pela FCRB organizadas em sequência numérica'),
(219, '1.14.2.2', 'Assinaturas autorizadas', 'Classificar os documentos referentes à autorização de assinaturas para movimento das contas bancárias: Presidência, Direção Executiva e Diretoria de Administração. '),
(220, '1.14.3', 'Câmbio', 'Classificar os documentos referentes  à troca de moeda, a pagamentos em moeda estrangeira, etc.'),
(221, '1.15', 'Contabilidade', NULL),
(222, '1.15.1', 'Plano de contas', 'Classificar os documentos referentes à atribuição de código que define o que está se pagando ou recebendo, relacionando a natureza de despesa, valores, etc.'),
(223, '1.15.2', 'Tabela de eventos', 'Classificar os documentos referentes à atribuição de código para eventos de caráter financeiro. EX.: Pagamentos da manutenção do jardim.'),
(224, '1.15.3', 'Contas pagas', 'Classificar as contas, faturas, etc., pagas pela FCRB, organizadas em sequência numérica.'),
(225, '1.15.4', 'Plano interno', 'Classificar os documentos referentes à codificação das unidades executoras da FCRB – DA, DE, CMD, CP, PRE - das metas setoriais (objetivo geral da unidade executora), das metas setoriais específicas (o que pode ser feito) e das ações (objetivos específicos).'),
(226, '1.16', 'Intervenção judicial', 'Classificar os documentos referentes às ações ordinárias, mandados de segurança, etc. Não inclui os processos na área trabalhista.'),
(227, '1.17', 'Associações', NULL),
(228, '1.17.1', 'Servidores', 'Classificar os documentos referentes aos procedimentos, objetivos, etc. para a formação e manutenção de associações de servidores.'),
(229, '1.17.2', 'Amigos da casa de Rui Barbosa', 'Classificar os documentos referentes à formação, objetivos e atuação da Associação dos Amigos da Casa de Rui Barbosa. EX: Prestação de contas, contratos, atas de reunião, correspondências, etc.'),
(230, '1.17.2.1', 'Organização e estrutura', 'Classificar os documentos  que retratem a organização e a estrutura da Associação de Amigos da Casa de Rui Barbosa. Incluem-se as alterações, propostas e projetos de alterações, os documentos referentes à criação, transformações institucionais e jurídicas, atribuições, estatutos, regimentos, regulamentos, Conselhos, Juntas registro nos órgãos competentes, atas, etc.'),
(231, '1.17.2.2', 'Contratos.Convênios. Projetos', 'Classificar os documentos referentes aos convênios, contratos e projetos firmados entre a Associação dos Amigos da Casa de Rui Barbosa e outras instituições.');
INSERT INTO `especie` (`id`, `indice`, `especie`, `descricao`) VALUES
(232, '1.17.2.3', 'Contábil-Financeira', 'Classificar os documentos referentes aos recursos financeiros, à arrecadação, à despesas, à demonstração de contas , abertura, fechamento e manutenção de contas bancárias, sua gestão e movimentação, etc. Incluem-se os balancetes, extratos bancários, recibos, notas fiscais, etc.'),
(233, '1.18', 'Tributos.Multas', 'Classificar os documentos referentes aos impostos como IPTU, taxas municipais de coleta de lixo, taxa de armazenagem de portos, isenções de impostos, etc. Abre- se uma pasta para cada tipo de taxa. Inclui pareceres, consultas, solicitações etc. sobre a matéria.'),
(234, '1.19', 'Licitação', 'Classificar os documentos referentes aos processos licitatórios da administração pública e na FCRB, as Certidões Negativas de Débito, etc. Os procedimentos propriamente ditos serão arquivados de acordo com o assunto.'),
(235, '1.20', 'Serviço de reprodução eletrostática (xerox)', NULL),
(236, '1.20.1', 'Cópias', 'Classificar os documentos referentes à reprodução por processos eletrostáticos (xerox), fixação de preços, direito de solicitar o serviço, etc. Inclui pedidos de conta de cópias  de documentos, envio de notas para pagamento, pedidos de cópias de publicações, etc.'),
(237, '1.20.2', 'Locação. Manutenção', 'Classificar os documentos referentes aos procedimentos para locação e manutenção de equipamento para a reprodução eletrostática de documentos (xerox). Não há necessidade de abrir pasta  para locação e outra para manutenção, porque a locação e contrato de manutenção constarão de processo de licitação.'),
(238, '2', 'Difusão Cultural', NULL),
(239, '2.1', 'Eventos culturais (FCRB)', 'Classificar os documentos referentes a outros eventos não descritos nos itens abaixo. Inclui atividades ao ar livre (exceto Colônia de Férias e atividades didáticas que se enquadram em Programas Especiais 3.3 e desdobramentos) e/ou eventos que envolvam mais de uma das atividades descritas.'),
(240, '2.1.1', 'Recitais. Concertos', 'Classificar os documentos referentes à apresentação de músicos e cantores na FCRB. Abrir pasta para cada Recital e Concerto.'),
(241, '2.1.2', 'Teatros', 'Classificar os documentos referentes à apresentação de peças de teatros e às oficinas de teatro. Abrir pasta para cada peça e/ou oficina.'),
(242, '2.1.3', 'Filmes', 'Classificar os documentos referentes a mostras de filmes na FCRB.'),
(243, '2.1.4', 'Exposições', 'Classificar os documentos referentes às exposições realizadas na FCRB e referentes a Rui Barbosa. Abrir pasta para cada exposição.'),
(244, '2.1.5', 'Feiras. Feiras de livros', 'Classificar os documentos referentes à realização de feiras literárias e/ou a participação em feiras de livros. Abrir pasta para cada feira, quando o volume de documentos justificar.'),
(245, '2.1.6', 'Lançamentos de publicações, discos, etc.', 'Classificar os documentos referentes aos lançamentos de publicações e discos que ocorrerem na FCRB. Os lançamentos de publicações da FCRB serão classificados em Editoração na pasta específica da publicação'),
(246, '2.1.7', 'Comemorações. Homenagens', 'Classificar os documentos referentes às homenagens a Rui Barbosa e outros personagens ilustres, à participação da FCRB em solenidades dentro e fora da FCRB como formaturas, aulas inaugurais, comemorações em geral, etc. Inclui documento referentes ao calendário medalhístico e filatélico.'),
(247, '2.2', 'Eventos Culturais (outras instituições)', 'Classificar os documentos referentes à realização de recitais, concertos, peças teatro, filmes, feiras de livros, lançamentos de publicações, discos, solenidades ( sem a participação da FCRB), etc. em outras instituições'),
(248, '2.3', 'Seminários. Congresso. Mesas-redondas (FCRB)', 'Classificar os documentos referentes à realização de semanários, Congressos, Mesas-redondas na FCRB. Abrir pasta específica para cada evento.'),
(249, '2.4', 'Seminários. Congresso. Mesas-redondas (Outras instituições)', 'Classificar os documentos referentes à realização de Seminários, Congressos, Mesas-redondas, etc. em outras instruções. Inclui a participação de servidor em eventos fora da FCRB, mesmo que não estejam em missão oficial. Não abrir pasta específica.'),
(250, '2.5', 'Divulgação', 'Classificas os documentos de caráter geral que visem à divulgação da FCRB e seus setores junto ao público. Ex: Folders.'),
(251, '2.5.1', 'Mala -Direta', 'Classificar os documentos referentes ao cadastro de pessoas e instituições de interesse da FCRB para divulgação de eventos, publicações, comunicados, etc. da instituição.'),
(252, '2.5.2', 'Impresa. Agenda', 'Classificar os documentos referentes à divulgação da FCB na imprensa, releases  etc. na pasta Imprensa, em caso de assuntos não específicos. Classificar os documentos referentes aos informes internos no formato Agenda, ou semelhante, na pasta com o nome do informe. Ex : Agenda'),
(253, '2.6', 'Semana da Cultura', 'Classificar os documentos referentes à programação da semana da Cultura ou Dia da Cultura na FCRB. Inclui todos os eventos realizados. Manter referência cruzada entre a Semana da Cultura e os eventos realizados em conjunto.'),
(254, '2.7', 'Concursos e prêmios', 'Classificar os documentos referentes aos concursos e premiações patrocinadas pela FCRB e/ou outras instituições. Abrir pasta específica sob a mesma codificação, para os concursos e premiações promovidos pela FCRB e outra pasta para os de outras instituições.'),
(255, '2.8', 'Venda de ingresso', 'Classificar os documentos referentes à venda de ingressos  para a participação em eventos e visitação ao Museu.'),
(256, '2.9', 'Logomarca da FCRB', 'Classificar os documentos referentes à identidade visual da FCRB.'),
(257, '3', 'Atividades didáticas', NULL),
(258, '3.1', 'Cursos (FCRB)', 'Classificar os documentos referentes aos cursos realizados na FCRB promovido ou não pela instituição. Abrir pasta para casa curso, quando o número de documentos justificar.'),
(259, '3.2', 'Cursos (outras instituições)', 'Classificar os documentos referentes aos cursos realizados fora da FCRB. Quando ocorrer participação de servidor que implique seu afastamento do serviço deve-se adotar a codificação: 1.8.13.7- Para o Brasil e 1.8.13.8 – Para o Exterior.'),
(260, '3.3', 'Programas especiais', 'Classificar os documentos referentes aos programas específicos na área de atividades didáticas, em geral voltados para o público infanto-juvenil. Abrir pasta para cada programa sob a mesma codificação.'),
(261, '3.3.1', 'Integração arquivo - escola', 'Classificar os documentos referentes ao programa já institucionalizado, que envolve atividades entre escolas e o Arquivo.'),
(262, '3.3.2', 'Integração museu - escola', 'Classificas os documentos referentes ao programa, já institucionalizado, que envolve atividades entre escolas e o Museu.'),
(263, '3.3.3', 'Colônia de férias', 'Classificar os documentos referentes ao programa, já institucionalizado, que envolve atividades voltadas para crianças no período de férias escolares.'),
(264, '3.3.4', 'Treinamento e reciclagem (LAPRE)', 'Classificar os documentos referentes ao treinamento de profissionais na área de conservação e restauração de documentos'),
(265, '4', 'Pesquisas e estudos', NULL),
(266, '4.1', 'Pesquisas históricas', 'Classificar os documentos referentes às atividades específicas, desenvolvidas pelo setor de Pesquisa Histórica da FCRB.'),
(267, '4.2', 'Pesquisa ruiana', 'Classificar os documentos referentes às atividades específicas, desenvolvidas pelo setor de Pesquisa Ruiana da FCRB.'),
(268, '4.3', 'Pesquisa jurídica', 'Classificar os documentos referentes às atividades específicas, desenvolvidas pelo setor de Pesquisa de Direito da FCRB.'),
(269, '4.4', 'Pesquisa filológica', 'Classificas os documentos referentes às atividades específicas, desenvolvidas pelo setor de Pesquisa de Filologia da FCRB.\nInclui as pesquisas sobre literatura e cordel.\n'),
(270, '5', 'Documentação e Informação', NULL),
(271, '5.1', 'Assistência técnica', 'Classificar os documentos resultantes da prestação de serviços de assistência técnica em todas as áreas referentes a documentação e informação. Inclui a elaboração de pareceres.  Abrir pasta para cada tipo de serviço.\nEx. Assistência Técnica, Restauração; Assistência Técnica, Microfilmagem, etc.\n'),
(272, '5.2', 'Relatórios técnicos', 'Classificar os relatórios técnicos elaborados pelos setores ligados à área de documentação e informação, etc.'),
(273, '5.3', 'Intercâmbio de informações', 'Classificar os documentos de divulgação de outras instituições culturais e/ou referentes à permuta de instrumentos de recuperação da informação.'),
(274, '5.4', 'Normas técnicas', 'Classificar as normas e diretrizes técnicas que envolvam áreas de documentação e informação.\nEx.: Normas sobre empréstimo de acervos, linha de acervo, etc.\n'),
(275, '5.5', 'Edição', 'Classificar os documentos referentes à editoração de publicações da FCRB e suas respectivas fases.'),
(276, '5.5.1', 'Editoração', 'Classificar os documentos referentes à preparação, impressão, arte-final, pedido de ISBN, etc. das obras da FCBR. Abrir pasta para cada publicação. Os fotolitos devem ser arquivados no LAMIC, os laserfilms devem ser arquivados juntamente com a documentação textual, devidamente acondicionados.'),
(277, '5.5.2', 'Publicação e impressos', 'Classificar os documentos sobre as publicações, impressos ( folders, cartazes, postais, etc.) da FCRB. Incluem-se camisetas, adesivos e outros matérias de divulgação da FCRB.'),
(278, '5.5.2.1', 'Direitos autorais', 'Classificar os documentos referentes ao pagamento e propostas de direitos autorais das publicações da FCRB.'),
(279, '5.5.2.2', 'Depósito legal', 'Classificar os documentos referentes ao depósito legal, junto à Biblioteca Nacional, das publicações da FCRB.'),
(280, '5.5.2.3', 'Propostas de publicação', 'Classificar os documentos referentes à apresentação de propostas de publicação da FCRB.'),
(281, '5.5.2.4', 'Co-edição', 'Classificar os documentos referentes às publicações editadas pela FCRB com auxílio de outra instituição. Em geral, constam convites, entendimentos para publicação, etc. Neste caso, fotolitos, arte-final, etc. ficam comumente com a editora.'),
(282, '5.5.2.5', 'Divulgação', 'Classificar os documentos utilizados para a divulgação de publicações da FCRB. O material de divulgações de publicações de outras instituições deve tramitar na FCRB com Guia de Encaminhamento, e após ciência do(s) setor(es) interessado(s) ser eliminado.'),
(283, '5.5.2.6', 'Distribuição', 'Classificar os documentos que se referem a mais de uma forma de distribuição de publicação e impressos da FCRB.'),
(284, '5.5.2.6.1', 'Venda', 'Classificar os documentos referentes à venda de publicações da FCRB. Ex.: Pedidos, notas, etc.'),
(285, '5.5.2.6.2', 'Permuta', 'Classificar os documentos referentes à permuta (troca) de publicações da FCRB pelas publicações de outras instituições.'),
(286, '5.5.2.6.3', 'Doação', 'Classificar os documentos referentes à doação pela FCRB de suas publicações, inclusive as co-editadas.\nEx.: Pedidos, notas, cartas de agradecimentos, comunicação internas, etc.\n'),
(287, '5.5.2.6.4', 'Alienação', 'Classificar os documentos referentes à alienação das publicações da FCRB por motivo de calamidade pública, sinistro ou deterioração.'),
(288, '5.5.2.7', 'Catálogo', 'Classificar as relações de publicações da FCRB e outros documentos referentes às mesmas. Ex.: Solicitações de catálogos.'),
(289, '5.6', 'Assinaturas ', NULL),
(290, '5.6.1', 'Diário Oficial', 'Classificar os documentos referentes à assinatura do Diário Oficial da União pela FCRB. Inclui documentos referentes ao D.O.U que não se enquadram em assuntos específicos. Ex: Recusa de publicação de matéria no D.O.U.'),
(291, '5.6.2', 'Outros periódicos', 'Classificar os documentos referentes às assinaturas de periódicos. As assinaturas de revistas acadêmicas e outras compatíveis com a linha de acervo devem ser classificadas em Acervo Bibliográfico, compra.'),
(292, '5.7', 'Acervo arquivístico.Acervo bibliográfico. Acervo museológico', 'Classificar de acordo com os assuntos, separadamente, formando conjuntos diferentes: Acervo Arquivístico, Acervo Bibliográfico e Acervo Museológico.'),
(293, '5.7.1', 'Aquisição de acervos', 'Classificar os documentos referentes às modalidades de aquisição de acervos, propostas e estabelecimentos de prioridades. Inclui as aquisições de Literatura de Cordel.'),
(294, '5.7.1.1', 'Doação', 'Classificar os documentos referentes à doação de acervos para a FCRB. Inclui os termos de doação firmados.'),
(295, '5.7.1.2', 'Compra', 'Classificar os documentos referentes à compra de acervos pela FCRB. No caso de acervos bibliográficos estão incluídas as revistas e periódicos (exceto o D.O.U e outros jornais).'),
(296, '5.7.1.3', 'Permuta', NULL),
(297, '5.7.1.4', 'Complementação', 'Classificar os documentos referentes ao(s) procedimento(s) de adquirir acervos documentos não originais (microfilmes, cópias eletrostáticas, etc.) a título de completar os acervos da FCRB'),
(298, '5.7.2', 'Acesso aos acervos e às informações', 'Classificar os documentos referentes à pesquisa aos bancos de dados da FCRB, tais como: ruiano, filológico, etc. No caso de acesso aos acervos classificar em 5.7.2.1.'),
(299, '5.7.2.1', 'Consultas. Pesquisa bibliográfica ou documental', 'Classificar os documentos referentes ao acesso às informações contidas nos acervos documentos da FCRB, através de correspondência, de visita de usuários, de telefonemas, etc. Abrir pasta específica para os procedimentos rotineiros de consultas e outra para a pesquisa aos acervos realizadas por funcionários da FCRB a pedido do usuário. Ex.: Consultas (inclui horário de funcionamento, informes gerais de conteúdo dos acervos, telefonemas atendidos; Pesquisa Bibliográfica ou Documental (inclui solicitação de buscas e trabalhos resultantes da pesquisa a '),
(300, '5.7.2.2', 'Empréstimo', 'Classificar os documentos referentes a empréstimo de acervos  a outras instituições. Ex.: Pedidos, consentimentos ou negativas, listagens, etc.'),
(301, '5.7.2.2.1', 'Seguro', 'Classificar os documentos referentes ao seguro que é feito quando ocorre o transporte de acervos documentais para fora das dependências da instituição.'),
(302, '5.7.2.3', 'Visitação ao museu', 'Classificar os documentos referentes à visitação ao museu Casa de Rui Barbosa. Abrir pasta para Visitas Escolares, para Turismo e também uma pasta com informações de interesse comum ou de informações como preço de visitação, horário de visitação, manifestações sobre dia e horário de visitação, etc.'),
(303, '5.7.3', 'Preservação dos acervos', 'Classificar os documentos referentes aos procedimentos para a preservação dos acervos. Inclui diagnóstico, estabelecimento de prioridades, etc.'),
(304, '5.7.3.1', 'Condições ambientais', 'Classificar os documentos referentes às definições, manutenção de condições ambientais para a preservação de documentos.'),
(305, '5.7.3.2', 'Armazenagem. Depósito temporário. Arquivo de segurança', 'Classificar os documentos referentes ao armazenamento e depósito temporário e definitiva de documentos no arquivo de segurança da FCRB, guarda de documentos da FCRB em depósito de outra instituição, etc. Abrir pasta para cada caso específico  se o acúmulo de documentos justificar.'),
(306, '5.7.3.3', 'Imunização. Higienização', 'Classificar os documentos referentes a desinfestação, descupinização, desratização na pasta Imunização e à retirada de poeira, sujidades e outros agentes de deterioração do acervo na pasta Higienização. Ex.: Acervo Arquivístico, Imunização; Acervo Bibliográfico, Imunização e Acervo Museológico, Imunização.'),
(307, '5.7.3.4', 'Restauração', 'Classificar os documentos referentes à atividade de restauração dos documentos da FCRB, não importa o tipo do documento : foto, carta, peça, livro, carro de Rui Barbosa, etc.\nEx.: Acervo Arquivístico, Restauração.\n'),
(308, '5.7.3.5', 'Encadernação', 'Classificar os documentos referentes à atividade de encadernação de obras do acervo da FCRB. Quando tratar-se de restauro de encadernação, classificar em restauração. Ex.: Acervo Bibliográfico, Encadernação.'),
(309, '5.7.4', 'Sistema de arquivos da FCRB', 'Classificar os documentos referentes à implantação e manutenção do Sistema de Arquivos da FCRB e a gestão de documentos em caráter geral.'),
(310, '5.7.4.1', 'Correspondência e outros documentos', NULL),
(311, '5.7.4.1.1', 'Expedição. Máquina de franquear', 'Classificar os documentos referentes à expedição de correspondência e outros documentos, e aluguel, compra e utilização de máquina de franquear, inclusive atualização de preços. Abrir pasta para Expedição e outra para Máquina de Franquear.'),
(312, '5.7.4.1.2', 'Malote', 'Classificar os documentos referentes à utilização do serviço de malote com o Ministério da Cultura.'),
(313, '5.7.4.1.3', 'Caixa postal', 'Classificar os documentos referentes à utilização dos serviços de caixas postais.'),
(314, '5.7.4.1.4', 'Serviço de Reembolso Postal. Sedex', 'Classificar os documentos referentes à utilização pela FCRB dos serviços da Empresa Brasileira '),
(315, '5.7.4.1.5', 'Recebimento. Classificação. Distribuição. Tramitação. Arquivamento', 'Classificar os documentos referentes às atividades de protocolo e arquivamento. Abrir pasta Recebimento, para Classificação, para Distribuição, para Tramitação e para Arquivamento. Inclui as fases corrente, intermediária e permanente.'),
(316, '5.7.5', 'Serviço de Rota', 'Classificar os documentos referentes à implantação, manutenção e modificações no serviço de rota.'),
(317, '5.7.6', 'Processamento técnico', 'Classificar os instrumentos de recuperação da informação e/ou pesquisa e outros documentos produzidos durante o tratamento técnico dos acervos documentais.'),
(318, '5.7.7', 'Avaliação e destinação de acervo', NULL),
(319, '5.7.7.1', 'Comissão de Avaliação e Destinação de Documentos', 'Classificar os documentos referentes à convocação, estudos, atuação da Comissão de Avaliação e Destinação de Documentos da FCRB.'),
(320, '5.7.7.2', 'Tabela de teporalidade de documentos', 'Classificar, além da própria tabela de temporalidade da FCRB, a legislação, os estudos, os pareceres, as fundamentações, etc. que a originaram. Inclui os documentos referentes à aprovação da tabela pela Administração.'),
(321, '5.7.7.3', 'Transferência. Recolhimento', 'Classificar as listagens e outros documentos referentes à transferência de documentos da fase corrente para a intermediária e ao recolhimento da documentação da fase corrente e/ou intermediária para a permanente. Abrir pasta Transferência e outra para Recolhimento.'),
(322, '5.7.7.4', 'Descarte. Elimininação', 'Classificação as listagens, termos e outros documentos referentes à eliminação de acervo, bem como o envio a outras instituições de documentação incompatível com a linha de acervo da FCRB. Abrir pasta para cada tipo de acervo: arquivístico, bibliográfico e museológico.'),
(323, '5.7.8', 'Reprodução de documentos', NULL),
(324, '5.7.8.1', 'Microfilmagem', 'Classificar os documentos referentes ao serviço de microfilmagem de acervos da FCRB, visando à preservação da informação e eliminação de originais, a preservação de originais, o acesso a documentos e o atendimento ao usuário. Inclui o Plano Nacional de Microfilmagem.'),
(325, '5.7.8.2', 'Fotografia. Fita de video. Filme. Fita sonora', 'Classificar os documentos referentes ao serviço de reprodução de documentos pelo processo fotográficos, filmagem em vídeo ou filme em rolo e gravações sonoras. Abrir pasta para cada processo de reprodução.'),
(326, '5.7.9', 'Custódia de acervos', 'Classificar os documentos referentes à colocação de acervos sob a responsabilidade da FCRB sem que haja a transferência de posse ou de propriedade.'),
(327, '5.8', 'Automação da informação. Processamento de dados', NULL),
(328, '5.8.1', 'Programas de informatização de dados', 'Classificar os documentos referentes aos planos e estudos de informatização de dados que envolvam a FCRB como um todo (a área técnica e a área administrativa). Os projetos de informatização serão arquivados na mesma codificação. Ex.: CALCO'),
(329, '5.8.2', 'Utilização de software', 'Classificar os documentos referentes ao uso de programas (softwares) de computador pela FCRB. Inclui sugestões de softwares, desenvolvimentos de programas específicos, etc.'),
(330, '5.8.3', 'Manuais', 'Classificar os manuais técnicos e manuais de usuários.');
